<svg class="animated empty-template"
  [ngClass]="{ 'empty-template--for-large': templateSize === 'large', 'empty-template--for-medium': templateSize === 'medium', 'empty-template--for-small': templateSize === 'small' }"
  id="freepik_stories-reading-list" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 500 500" version="1.1"
  xmlns:xlink="http://www.w3.org/1999/xlink" xmlns:svgjs="http://svgjs.com/svgjs"
  *ngIf="templateType === 'TRANSACTIONS'">
  <style>
    svg#freepik_stories-reading-list:not(.animated) .animable {
      opacity: 0;
    }

    svg#freepik_stories-reading-list.animated #freepik--background-complete--inject-6 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideUp;
      animation-delay: 0s;
    }

    svg#freepik_stories-reading-list.animated #freepik--Floor--inject-6 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomIn;
      animation-delay: 0s;
    }

    svg#freepik_stories-reading-list.animated #freepik--Plant--inject-6 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomIn;
      animation-delay: 0s;
    }

    svg#freepik_stories-reading-list.animated #freepik--Character--inject-6 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideRight;
      animation-delay: 0s;
    }

    svg#freepik_stories-reading-list.animated #freepik--speech-bubble--inject-6 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) lightSpeedRight;
      animation-delay: 0s;
    }

    @keyframes slideUp {
      0% {
        opacity: 0;
        transform: translateY(30px);
      }

      100% {
        opacity: 1;
        transform: inherit;
      }
    }

    @keyframes zoomIn {
      0% {
        opacity: 0;
        transform: scale(0.5);
      }

      100% {
        opacity: 1;
        transform: scale(1);
      }
    }

    @keyframes slideRight {
      0% {
        opacity: 0;
        transform: translateX(30px);
      }

      100% {
        opacity: 1;
        transform: translateX(0);
      }
    }

    @keyframes lightSpeedRight {
      from {
        transform: translate3d(50%, 0, 0) skewX(-20deg);
        opacity: 0;
      }

      60% {
        transform: skewX(10deg);
        opacity: 1;
      }

      80% {
        transform: skewX(-2deg);
      }

      to {
        opacity: 1;
        transform: translate3d(0, 0, 0);
      }
    }
  </style>

  <style>
    svg#freepik_stories-progress-overview:not(.animated) .animable {
      opacity: 0;
    }

    svg#freepik_stories-progress-overview.animated #freepik--background-complete--inject-12 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) fadeIn;
      animation-delay: 0s;
    }

    svg#freepik_stories-progress-overview.animated #freepik--Floor--inject-12 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) lightSpeedLeft;
      animation-delay: 0s;
    }

    svg#freepik_stories-progress-overview.animated #freepik--chart-2--inject-12 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) zoomOut;
      animation-delay: 0s;
    }

    svg#freepik_stories-progress-overview.animated #freepik--chart-1--inject-12 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideDown;
      animation-delay: 0s;
    }

    svg#freepik_stories-progress-overview.animated #freepik--speech-bubble--inject-12 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) slideUp;
      animation-delay: 0s;
    }

    svg#freepik_stories-progress-overview.animated #freepik--Character--inject-12 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) fadeIn;
      animation-delay: 0s;
    }

    svg#freepik_stories-progress-overview.animated #freepik--Plant--inject-12 {
      animation: 1s 1 forwards cubic-bezier(0.36, -0.01, 0.5, 1.38) lightSpeedLeft;
      animation-delay: 0s;
    }

    @keyframes fadeIn {
      0% {
        opacity: 0;
      }

      100% {
        opacity: 1;
      }
    }

    @keyframes lightSpeedLeft {
      from {
        transform: translate3d(-50%, 0, 0) skewX(20deg);
        opacity: 0;
      }

      60% {
        transform: skewX(-10deg);
        opacity: 1;
      }

      80% {
        transform: skewX(2deg);
      }

      to {
        opacity: 1;
        transform: translate3d(0, 0, 0);
      }
    }

    @keyframes zoomOut {
      0% {
        opacity: 0;
        transform: scale(1.5);
      }

      100% {
        opacity: 1;
        transform: scale(1);
      }
    }

    @keyframes slideDown {
      0% {
        opacity: 0;
        transform: translateY(-30px);
      }

      100% {
        opacity: 1;
        transform: translateY(0);
      }
    }

    @keyframes slideUp {
      0% {
        opacity: 0;
        transform: translateY(30px);
      }

      100% {
        opacity: 1;
        transform: inherit;
      }
    }
  </style>
